package com.yangyao.backoffice.model;import com.alibaba.fastjson.annotation.JSONField;public class Parks {  private String parkId;  private String status;  @JSONField(format = "yyyy-MM-dd HH:mm:ss")  private java.sql.Timestamp lastUpdate;  private String voltage;  @JSONField(format = "yyyy-MM-dd HH:mm:ss")  private java.sql.Timestamp stateChangeTime;  public String getParkId() {    return parkId;  }  public void setParkId(String parkId) {    this.parkId = parkId;  }  public String getStatus() {    return status;  }  public void setStatus(String status) {    this.status = status;  }  public java.sql.Timestamp getLastUpdate() {    return lastUpdate;  }  public void setLastUpdate(java.sql.Timestamp lastUpdate) {    this.lastUpdate = lastUpdate;  }  public String getVoltage() {    return voltage;  }  public void setVoltage(String voltage) {    this.voltage = voltage;  }  public java.sql.Timestamp getStateChangeTime() {    return stateChangeTime;  }  public void setStateChangeTime(java.sql.Timestamp stateChangeTime) {    this.stateChangeTime = stateChangeTime;  }}